import React, { useState, useEffect } from 'react';
import './Profile.css';

const Profile = () => {
    const [activeTab, setActiveTab] = useState('listings');
    const [tickets, setTickets] = useState([]);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    useEffect(() => {
        if (activeTab === 'listings') {
            fetchUserListings();
        }
    }, [activeTab]);

    const fetchUserListings = async () => {
        setLoading(true);
        setError(null);
        const token = localStorage.getItem('jwtToken');

        if (!token) {
            console.error('No token found');
            return;
        }

        try {
            const response = await fetch(`${process.env.API_BASE_URL}/get-user-listing`, {
                method: 'GET',
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });

            if (!response.ok) {
                throw new Error(`Failed to fetch listings. Status: ${response.status}`);
            }

            const data = await response.json();
            setTickets(data.Tickets || []);
        } catch (error) {
            console.error('Error fetching listings:', error);
            setError('Failed to fetch listings.');
        } finally {
            setLoading(false);
        }
    };

    const formatDate = (dateString) => {
        const options = { year: 'numeric', month: '2-digit', day: '2-digit' };
        return new Date(dateString).toLocaleDateString(undefined, options);
    };

    return (
        <div className="profile-container">
            <h1 className="profile-title">Profile</h1>

            <div className="tabs">
                <button
                    className={`tab ${activeTab === 'listings' ? 'active' : ''}`}
                    onClick={() => setActiveTab('listings')}
                >
                    My Listings
                </button>
                <button
                    className={`tab ${activeTab === 'biddings' ? 'active' : ''}`}
                    onClick={() => setActiveTab('biddings')}
                >
                    My Biddings
                </button>
            </div>

            <div className="tab-content">
                {activeTab === 'listings' && (
                    <div className="listings-section">
                        <h2 className="section-title">My Listings</h2>
                        {loading ? (
                            <p className="loading-message">Loading...</p>
                        ) : error ? (
                            <p className="error-message">{error}</p>
                        ) : tickets.length === 0 ? (
                            <p className="no-listings-message">You don't have any listings yet.</p>
                        ) : (
                            <div className="listings-grid">
                                {tickets.map((ticket, index) => (
                                    <div key={index} className="listing-card">
                                        <div className="listing-header">
                                            <span className="event-date">{formatDate(ticket.eventDate)}</span>
                                            <span className="listed-by">Listed by: {ticket.listedBy}</span>
                                        </div>
                                        <div className="listing-details">
                                            <h3>Seats:</h3>
                                            <ul className="seat-list">
                                                {ticket.seatInfo.map((seat, seatIndex) => (
                                                    <li key={seatIndex}>
                                                        Seat {seat.seatNumber} (Block: {seat.block}, Level: {seat.level})
                                                    </li>
                                                ))}
                                            </ul>
                                            <p className="price">Price: â‚¹{ticket.price}</p>
                                            <p className="deadline">
                                                Deadline: {formatDate(ticket.deadline) || formatDate(ticket.eventDate)}
                                            </p>
                                        </div>
                                    </div>
                                ))}
                            </div>
                        )}
                    </div>
                )}

                {activeTab === 'biddings' && (
                    <div className="biddings-section">
                        <h2 className="section-title">My Biddings</h2>
                        <p className="coming-soon-message">Biddings functionality will be available soon.</p>
                    </div>
                )}
            </div>
        </div>
    );
};

export default Profile;
